import usersData from './usersData';

const Users = () => {
    console.log(usersData);
    return (
        <div>
            {usersData.map((user) => (
                <div key={user.id}>
                    <p>Name: {user.name}</p>
                    <p>Age: {user.age}</p>
                </div>
            ))}
        </div>
    );
}

export default Users;
